const PROJECTS = [{Title : "Movie Browser", Description : "Movie Browser Mobile App in React Native Works on both Android & IOS", Language : "Javascript", Stars : "10", link : "https://github.com/CosmicSage/Project2.git"}];

export default class Table extends React.Component {
  componentDidMount() {
    this.forceUpdate();
  }
  render() {
    return (
      <div class="react-bootstrap-table">
      <table class="table">
        <thead>
          <tr>
            {Object.keys(PROJECTS[0]).map(head => {
              if (head ==="link") return null;
              return <th className='T' scope="col">{head}</th>;
            })}
          </tr>
        </thead>
        <tbody>
          {PROJECTS.map(object => {
            const link = object.link;
            return (
              <tr>
                {Object.entries(object).map(( [ key,value ] ) => {
                    if (key === "link") return null;
                    if (key ==="Title") return <td className='T'><a className="whiteTxt plainLink" target="_blank" href={`${link}`}>{value}</a></td>;
                    return <td className='T'>{value}</td>;
                  }
                )}
              </tr>
            );
          })}
        </tbody>
      </table>
      <style jsx>{`
        tbody, thead {
          color : white;
        }

        .T {
          padding-top : 15px;
          padding-bottom : 20px;
          border-color : #222222;
        }

        .table {
          width: 100%;
          margin-bottom: 1rem;
          color: #212529;
        }

        .plainLink {
          color: white;
          font-family: "Gravity-Regular";
          display : table;
        }
        `}</style>
      </div>
    );
  }
}
